import React from 'react';
import posed from 'react-pose';

const ArrowComponent = (props) => {
    const returnedArrowComponent = posed.div({
        idle: { scale: 1 },
        hovered: { scale: 1.5 }
    });

    return (
        <div onClick={props.click}></div>
    )
}

export default ArrowComponent;
